import { Component, Input, OnInit } from '@angular/core';
import { JwtClientService } from '../jwt-client.service';

@Component({
  selector: 'app-edit-task',
  templateUrl: './edit-task.component.html',
  styleUrls: ['./edit-task.component.css']
})
export class EditTaskComponent implements OnInit{

  task:any;
  constructor(private service:JwtClientService){
    this.service.editTask$.subscribe((message)=>{
      this.task=message;
      console.log(message)
    })
  }


  ngOnInit(): void {

  }

}
<form>
    <div class="form-group">
      <label for="formGroupExampleInput">Name</label>
      <input type="text" class="form-control" id="formGroupExampleInput" [placeholder]="taks.name" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Start Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.startDate" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">End Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.endDate">
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Status</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.status">
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Priority</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.priority">
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Progress</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.priority">
    </div>
    <button type="submit" class="btn btn-primary">Update</button>
  </form>
